import React, { Component } from "react";
import {Table} from 'react-bootstrap';

export default class Contactos extends Component {
    render(){
        return(
        <div>
        <h1>Contactos</h1>
        <Table striped bordered hover>
            <thead>
                <tr>
                    <th>Nombre</th>
                    <th>Apellidos</th>
                    <th>Telefono</th>
                    <th>Categoria</th>
                </tr>
            </thead>
        </Table>
        </div>
    )
    }
}
